import React from 'react'

type Props = {
  setBallTeam:React.Dispatch<React.SetStateAction<string>>
}

const BallTeam:React.FC<Props> = ({setBallTeam}) => {

  const handleChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    // console.log(e.target.value);
    setBallTeam(e.target.value);
  }
  return (
    <>
    <div className="mx-2 "><h5>Ball on Team</h5></div>
        <select name="example" onChange={(e) => handleChange(e)} className="col-10 col-sm-3">
            <option value="-">-</option>
            <option value="Steelers">Steelers</option>
            <option value="Bengals">Bengals</option>
        </select>
    </>
  )
}

export default BallTeam
